mapper.select:

select 

from cms_survey
 where del_flag = 'N'

  and (title like CONCAT('%',#{title},'%')  or DESCRIPTION like CONCAT('%',#{title},'%'))


  and status = #{status}


  and repeat_limit = #{repeatLimit}


  and REGISTER = #{register}


  and type = #{type}
